import React from 'react';

class Table extends React.Component {
    render() {
      const content = this.props.content;
      return (
        <div id="Table">
          <table>
            <tbody>
              <tr>
                <th>Session</th>
                <th>Timeslot</th>
                <th>Speaker</th>
                <th>Room</th>
                <th>Action</th>
              </tr>
              {content.map(item => {
                return (
                  <tr>
                    <td>{content.Session}</td>
                    <td>{content.Timeslot}</td>
                    <td>{content.Speaker}</td>
                    <td>{content.Room}</td>
                    <td>{item.Action}</td>
                  </tr>
                );
              })}
            </tbody>
          </table>
        </div>
      );
    }
  }
  
  export default Table;
